import React, { Component } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";
import Cookies from "universal-cookie";

import Navbar from "react-bootstrap/Navbar";
import Button from "react-bootstrap/Button";
import Nav from "react-bootstrap/Nav";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";

class MyNavBar extends Component {
  state = {};

  render() {
    console.log(this.props);
    return this.props.isLogged ? this.userNav() : this.unknownNav();
  }
  userNav = () => {
    const cookies = new Cookies();
    const token = cookies.get("access");
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand>RazSocial</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link onClick={() => this.props.history.push("/")}>
              Home
            </Nav.Link>
            <Nav.Link onClick={() => this.props.history.push("login")}>
              Logout
            </Nav.Link>
          </Nav>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-info">Search</Button>
          </Form>
        </Navbar>
      </div>
    );
  };

  unknownNav = () => {
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand>RazSocial</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link onClick={() => this.props.history.push("/")}>
              Home
            </Nav.Link>
            <Nav.Link onClick={() => this.props.history.push("login")}>
              Login
            </Nav.Link>
          </Nav>
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-info">Search</Button>
          </Form>
        </Navbar>
      </div>
    );
  };
}

const mapStateToProps = state => ({
  isLogged: state.user.isLogged
});

export default withRouter(connect(mapStateToProps)(MyNavBar));
